import React from 'react';

class ContactUs extends React.Component{
    state = {
        _modalOpen: false
    }
    render(){
        return (
            <div className='contact_cont pr-4'>
                <button className='btn'>
                    CONTACT US
                </button>
            </div>
        )
    }
}

export default ContactUs;
